import React from "react";
import SearchMap from "./components/SearchMap";

// import './components/css/map.css';

const App = () => (
    <div className="App">
        <h1>카카오 맵 검색</h1>
        <SearchMap />

        <br/>

        <h1>네이버 맵 검색</h1>
    </div>
);

export default App;
